import React, { Component } from "react";

class Seats extends Component {
  render() {
    return (
      <div className="seat">
        <input type="checkbox" id="1A" />
        <label for="1A">{this.props.seatNumber}</label>
      </div>
    );
  }
}

export default Seats;
